import './App.css';
import Logo from './logo';
import SearchBar from './searchBar';
import Upload from './upload';
import "bootstrap/dist/css/bootstrap.min.css";
import Results from './results';
import { useState } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  const [resultsData, setResultsData] = useState(null);

  const renderResults = (data) => {
    setResultsData(data);
  };

  return (
    <Router>
      <div className="App">
        <div className='topBar'>
          <div id='logo'>
            <Logo/>
          </div>
          <div id="title-box">
            <div id="title-text">Bioanalytical Procedure Database System</div>
            <div id="sub-text">The Data Mine - Corporate Partners: Merck NLP</div>
          </div>
          <div id='search'>
            <SearchBar renderResults={renderResults}/>
          </div>
          <div id='upload'>
            <Upload/>
          </div>
          <div id='results'>
            <Link to="/results">View Results</Link>
          </div>
        </div>
        <Route path="/results" render={() => <Results resultsData={resultsData} />} />
      </div>
    </Router>
  );
}

export default App;
